import React from 'react'

export default function TextForm(props) {
    return (
        <div>
            <div className="container my-">
                <h1> {props.heading} </h1>
                <div class="form-group">
                    <textarea class="form-control" id="myForm" rows="3"></textarea>
                </div>
            </div>
        </div>
    )
}
